import React from "react";

const ItsOverNineThousand = (props) => {
	const rendering = () => {
		if (props.result > 9000) {
			return (
				<div>
					<h1>Yahou</h1>
				</div>
			);
		}
	};
};

export default ItsOverNineThousand;
